import React, { useEffect, useContext } from 'react';
import UserContext from '../../context/UserContext';
import { useHistory } from 'react-router-dom';

function Home() {
    const { userData } = useContext(UserContext);
    const history = useHistory();

    useEffect(() => {

        if(!userData.user){
            history.push('/login')
        }

    }, [userData]);
    return (
        <div className='page'>
            Home
        </div>
    )
}

export default Home
